import "./App.css";
import SignUp from "./Components/SignUp";
import Header from "./Components/Header";
import SignIn from "./Components/SignIn";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<SignIn />}></Route>
      </Routes>
    </>
  );
}

export default App;
